import React, { useState } from 'react';

const App = () =>{
    var objF ={
        num: []
    }
    const [values, setValues] = useState(0);

    const inputEvent =(event) =>{
        setValues(values.concat(event.target.value))
    }
    const calculate =() =>{
        try{
            setValues(eval(values).toString())
        }catch(err){
            setValues("error")
        }
    }

    return(
        <div className="body">
            <h1>Calculator</h1>
            <div className="display"> 
            <input type="text" value={values} onChange={inputEvent}/>
            </div>

            <div className="button">
            <button onClick={inputEvent} value ="1">1</button>
            <button onClick={inputEvent} value ="2">2</button>
            <button onClick={inputEvent} value ="3">3</button>
            <button onClick={inputEvent} value ="+">+</button>

            <button onClick={inputEvent} value ="4">4</button>
            <button onClick={inputEvent} value ="5">5</button>
            <button onClick={inputEvent} value ="6">6</button>
            <button onClick={inputEvent} value ="-">-</button>

            <button onClick={inputEvent} value ="7">7</button>
            <button onClick={inputEvent} value ="8">8</button>
            <button onClick={inputEvent} value ="9">9</button>
            <button onClick={inputEvent} value ="*">*</button>

            <button onClick={inputEvent} value =".">.</button>
            <button onClick={inputEvent} value ="0">0</button>
            <button onClick={inputEvent} value ="=">=</button>
            <button onClick={calculate} id="values" value ="/">/</button>
            </div>
            </div>

    );
}

export default App;
